INSERT INTO `movie` VALUES ('tt0068646','The Godfather','The aging patriarch of an organized crime dynasty transfers control of his clandestine empire to his reluctant son.',9.2,'Best Picture, Blockbuster, 200 Tickets, New Award'),('tt0088763','Back to the Future','Marty McFly, a 17-year-old high school student, is accidentally sent thirty years into the past in a time-traveling DeLorean invented by his close friend, eccentric scientist Doc Brown.',8.5,'Blockbuster, 200 Tickets, New Award'),('tt0102926','The Silence of the Lambs','A young F.B.I. cadet must receive the help of an incarcerated and manipulative cannibal killer to help catch another serial killer, a madman who skins his victims.',8.6,'Blockbuster, 200 Tickets, New Award'),('tt0108052','Schindler\'s List','In German-occupied Poland during World War II, Oskar Schindler gradually becomes concerned for his Jewish workforce after witnessing their persecution by the Nazi Germans.',8.9,'Best Picture, Blockbuster, 200 Tickets, New Award'),('tt0109830','Forrest Gump','The presidencies of Kennedy and Johnson, the Vietnam War, the Watergate scandal and other historical events unfold through the perspective of an Alabama man with an IQ of 75, whose only desire is to be reunited with his childhood sweetheart.',8.8,'Best Picture, Blockbuster, 200 Tickets, New Award'),('tt0110357','The Lion King','Lion cub and future king Simba searches for his identity. His eagerness to please others and penchant for testing his boundaries sometimes gets him into trouble.',8.5,'Blockbuster, 200 Tickets, New Award'),('tt0110912','Pulp Fiction','The lives of two mob hitmen, a boxer, a gangster and his wife, and a pair of diner bandits intertwine in four tales of violence and redemption.',8.9,'Best Picture, Blockbuster, 200 Tickets, New Award'),('tt0111161','The Shawshank Redemption','Two imprisoned men bond over a number of years, finding solace and eventual redemption through acts of common decency.',9.3,'Best Picture, Blockbuster, 200 Tickets, New Award'),('tt0114814','The Usual Suspects','A sole survivor tells of the twisty events leading up to a horrific gun battle on a boat, which began when five criminals met at a seemingly random police lineup.',8.5,'Blockbuster, 200 Tickets, New Award'),('tt0120689','The Green Mile','The lives of guards on Death Row are affected by one of their charges: a black man accused of child murder and rape, yet who has a mysterious gift.',8.6,'Blockbuster, 200 Tickets, New Award'),('tt0120815','Saving Private Ryan','Following the Normandy Landings, a group of U.S. soldiers go behind enemy lines to retrieve a paratrooper whose brothers have been killed in action.',8.6,'Blockbuster, 200 Tickets, New Award'),('tt0133093','The Matrix','A computer hacker learns from mysterious rebels about the true nature of his reality and his role in the war against its controllers.',8.7,'Blockbuster, 200 Tickets, New Award'),('tt0137523','Fight Club','An insomniac office worker and a devil-may-care soapmaker form an underground fight club that evolves into something much, much more.',8.8,'Best Picture, Blockbuster, 200 Tickets, New Award'),('tt0167260','The Lord of the Rings: The Return of the King','Gandalf and Aragorn lead the World of Men against Sauron\'s army to draw his gaze from Frodo and Sam as they approach Mount Doom with the One Ring.',8.9,'Best Picture, Blockbuster, 200 Tickets, New Award'),('tt0167261','The Lord of the Rings: The Two Towers','While Frodo and Sam edge closer to Mordor with the help of the shifty Gollum, the divided fellowship makes a stand against Sauron\'s new ally, Saruman, and his hordes of Isengard.',8.7,'Blockbuster, 200 Tickets, New Award'),('tt0172495','Gladiator','A former Roman General sets out to exact vengeance against the corrupt emperor who murdered his family and sent him into slavery.',8.5,'Blockbuster, 200 Tickets, New Award'),('tt0253474','The Pianist','A Polish Jewish musician struggles to survive the destruction of the Warsaw ghetto of World War II.',8.5,'Blockbuster, 200 Tickets, New Award'),('tt0407887','The Departed','An undercover cop and a mole in the police attempt to identify each other while infiltrating an Irish gang in South Boston.',8.5,'Blockbuster, 200 Tickets, New Award'),('tt0468569','The Dark Knight','When the menace known as The Joker emerges from his mysterious past, he wreaks havoc and chaos on the people of Gotham.',9.0,'Best Picture, Blockbuster, 200 Tickets, New Award'),('tt0482571','The Prestige','After a tragic accident, two stage magicians engage in a battle to create the ultimate illusion while sacrificing everything they have to outwit each other.',8.5,'Blockbuster, 200 Tickets, New Award'),('tt0816692','Interstellar','A team of explorers travel through a wormhole in space in an attempt to ensure humanity\'s survival.',8.6,'Blockbuster, 200 Tickets, New Award'),('tt1285016','The Social Network','As Harvard student Mark Zuckerberg creates the social networking site that would become known as Facebook, he is sued by the twins who claimed he stole their idea, and by the co-founder who was later squeezed out of the business.',7.7,'Blockbuster, 200 Tickets, New Award'),('tt1345836','The Dark Knight Rises','Eight years after the Joker\'s reign of anarchy, Batman, with the help of the enigmatic Catwoman, is forced from his exile to save Gotham City from the brutal guerrilla terrorist Bane.',8.4,'Blockbuster, 200 Tickets, New Award'),('tt1375666','Inception','A thief who steals corporate secrets through the use of dream-sharing technology is given the inverse task of planting an idea into the mind of a C.E.O.',8.8,'Best Picture, Blockbuster, 200 Tickets, New Award'),('tt1663202','The Revenant','A frontiersman on a fur trading expedition in the 1820s fights for survival after being mauled by a bear and left for dead by members of his own hunting team.',8.0,'Blockbuster, 200 Tickets, New Award'),('tt1675434','The Intouchables','After he becomes a quadriplegic from a paragliding accident, an aristocrat hires a young man from the projects to be his caregiver.',8.5,'Blockbuster, 200 Tickets, New Award'),('tt1853728','Django Unchained','With the help of a German bounty hunter, a freed slave sets out to rescue his wife from a brutal Mississippi plantation owner.',8.4,'Blockbuster, 200 Tickets, New Award'),('tt18537281','The Great Movie','An amazing movie',8.5,''),('tt185372811','The Great Movie','An amazing movie',8.5,''),('tt1853728111','The Great Movie','An amazing movie',8.5,''),('tt18537281111','The Great Movie','An amazing movie',8.5,''),('tt185372811111','The Great Movie','An amazing movie',8.5,''),('tt1853728111111','The Great Movie','An amazing movie',8.5,''),('tt18537281111111','The Great Movie','An amazing movie',8.5,''),('tt185372811111111','Spy','Funny',9.0,'');
